import React, { useEffect, useState } from 'react';

const StationsList = ({ titulo, url }) => {

    const [station, setStation] = useState([]);


    useEffect(() => {
        console.log(station);
        obtenerDatos();
    }, [])

    const obtenerDatos = async() => {
        const data = await fetch(url);
        const stations = await data.json();
        setStation(stations.ListaEESSPrecio);
    }

    const stationOrdenada = station.sort((o1, o2) => {
        return o1['Precio Gasolina 95 E5'] - o2['Precio Gasolina 95 E5'];
    })

    console.log(stationOrdenada);


    return (
        <div>
            <h2 className='text-center'>{titulo}</h2>
        <div className='row d-flex flex-row'>
            {stationOrdenada.map((item,index) => (
                <div key={index} className='col p-2'>
                    <div className='card' style={{width: '300px'}}>
                        <div className='card-body text-center'>
                            <h6 className='card-title'>{item['Rótulo']}</h6>
                            <h6 className='mb-2 text-muted' style={{fontSize: '14px'}}>{item.Horario}</h6>
                            <hr />
                            <p>Localidad: {item.Localidad}</p>
                            <p className='text-lowercase text-capitalize '>Dirección: {item['Dirección']} </p>
                            <p>Precio Gasolina 95: {item['Precio Gasolina 95 E5']} € </p>
                            <p>Precio Gasolina 98: {item['Precio Gasolina 98 E5']} € </p>
                            <p>Precio Gasóleo: {item['Precio Gasoleo A']} € </p>
                        </div>
                    </div>
                </div>
            ))}
        </div>
        </div>
    );
}

export default StationsList;

